"airdrop_withdraw_intro_content" : "1. By default, the withdrawal will be transferred to your current account. If you wish to withdraw to another account, please switch manually; 
2. After you apply for withdrawal, you need to wait for manual audit before it takes effect. We will accept your application within 2 working days. 
3. Withdrawals to wallets other than HiWallet are not currently supported."
